import React from 'react';
import ReactDOM from 'react-dom';
import Slick from 'react-slick';

const Carousel = () => {
  const items = [1, 2, 3, 4, 5];

  return (
    <div>
      <Slick
        dots={true}
        infinite={true}
        slidesToShow={3}
        slidesToScroll={1}
        arrows={true}
        items={items}
        key={items}
        responsive={[
          {
            breakpoint: 768,
            settings: {
              slidesToShow: 2,
              slidesToScroll: 1,
            },
          },
          {
            breakpoint: 576,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 1,
            },
          },
        ]}
      >
        {items.map((item, index) => (
          <div key={index}>{item}</div>
        ))}
      </Slick>
    </div>
  );
};

export default Carousel;
